import React from 'react'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom'
import classes from './MenuHome.module.css'

const MenuHome = (props) => {
  const { link, active } = props
  const listMenu = [
    {
      id: 1,
      title: 'Home',
      link: '/',
    },
    {
      id: 2,
      title: 'Course',
      link: '/',
    },
    {
      id: 3,
      title: 'Become a teacher',
      active: false,
    },
    {
      id: 4,
      title: 'Account',
      active: false,
    },
  ]
  return (
    <Router>
      <div className={classes.AppHeaderMenu}>
        <nav>
          <ul className={classes.AppHeaderMenuItem}>
            {listMenu.map((item) => <li key={item.id}>
              <Link
                href={link}
                onClick={
                  console.log('item.title', item.title)
                }
                className={active ? classes.active : null}
              >
                {item.title}
              </Link>
            </li>)}
          </ul>
        </nav>
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/users">
            <Users />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  )
}
export default MenuHome
